import React, { useState, useEffect } from "react";

const ContactForm = () => {
  const initialFieldValues = {
    fullName: "",
    mobile: "",
    email: "",
    address: "",
  };

  var [values, setValues] = useState(initialFieldValues);
  return (
    <form autoComplete="off">
      <div className="form-"></div>
    </form>
  );
};

export default ContactForm;
